import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { useAuthr } from '../Login/peticion';


function Profile(){
    const auth=useAuthr();
    console.log("un profile",auth.user)
    return(
    <Container>
        <Row>
            <Col>
            <h2>Lado A </h2>
            </Col>

            <Col>
            <h2>Lado b </h2>
            </Col>
        </Row>
    </Container>
    )
}

export {Profile}
